title: ieee39 Bus System 
version: "1.0"
description: 4 Bus Powergrid Test Network

# special words are "MODEL", "CONSTRUCTOR", "ARGS", "WRAPPER"
Models:
  KirchhoffBus:
    CONSTRUCTOR: MTKBus

  ZIPLoad:
    CONSTRUCTOR: ZIPLoad
    KpZ: 1.0
    KpC: 0.0
    KpI: 0.0
    KqZ: 1.0
    KqI: 0.0
    KqC: 0.0
    # Pset defined in bus
    name: :load

  LoadBus:
    CONSTRUCTOR: MTKBus
    ARGS:
      - Models.ZIPLoad

  ## Base Machine model
  Machine:
    CONSTRUCTOR: SauerPaiMachine
    name: :machine

  AVRTypeI:
    CONSTRUCTOR: AVRTypeI
    ceiling_function: :quadratic
    name: :avr

  TGOV1:
    CONSTRUCTOR: TGOV1
    name: :gov

  ControlledGenerator:
    CONSTRUCTOR: CompositeInjector
    ARGS:
      - Models.Machine
      - Models.AVRTypeI
      - Models.TGOV1
    name: :ctrld_gen

  ControlledGenBus:
    CONSTRUCTOR: MTKBus
    ARGS:
      - Models.ControlledGenerator

  LoadControlledGenBus:
    CONSTRUCTOR: MTKBus
    ARGS:
      - Models.ZIPLoad
      - Models.ControlledGenerator

  LoadMachineBus:
    CONSTRUCTOR: MTKBus
    ARGS:
      - Models.ZIPLoad
      - MODEL: Models.Machine
        vf_input: false
        τ_m_input: false

  ## line models

  PiBranch:
    CONSTRUCTOR: PiLine_fault
    name: :pibranch

  PiLine:
    CONSTRUCTOR: MTKLine
    ARGS:
      - Models.PiBranch

  ## Powerflow models
  PF_PQ:
    CONSTRUCTOR: pfPQ 
    P: 0.0
    Q: 0.0
    
  PF_PV:
    CONSTRUCTOR: pfPV 
    
  PF_Slack:
    CONSTRUCTOR: pfSlack 


